def replace_mpi(value):
    """Replaces M_PI with the actual value of pi and evaluates the string numerically."""
    if isinstance(value, str) and 'M_PI' in value:
        return eval(value.replace('M_PI', str(np.pi)))
    return value


def replace_nan(value):
    """Replaces the string 'nan' with np.nan."""
    if value == "nan":
        return np.nan
    return value


def get_num_pdict():
    # deep copy of pdict so the original values are unaltered
    pdict_num = copy.deepcopy(pdict)
    for key, values in pdict_num.items():
        # replace M_PI and 'nan' with numerical values
        pdict_num[key] = [replace_mpi(replace_nan(v)) for v in values]

    return pdict_num


def p_ranges():
    """Returns the numerical min and max of the parameters in pdict."""
    pdict_num = get_num_pdict()

    minmax = {}
    for key, values in pdict_num.items():  # get the min and max of each parameter
        if isinstance(values[0], (float, int)):
            sorted_vals = sorted(set(values))
            # second_highest_val = sorted_vals[-2] if len(sorted_vals) > 1 else sorted_vals[-1]
            minmax[key] = (min(values), max(values))
            # minmax[key] = (min(values), second_highest_val)
            # minmax[key] = (np.percentile(values, 25), np.percentile(values, 75))
        elif "true" in values and "false" in values:
            minmax[key] = ("false", "true")
        elif all(v == "true" for v in values):
            minmax[key] = ("true", "true")
        elif all(v == "false" for v in values):
            minmax[key] = ("false", "false")
        elif all(isinstance(v, str) for v in values):
            minmax[key] = (np.nan, np.nan)

    ranges = {}
    for key, (min_val, max_val) in minmax.items():
        if isinstance(min_val, (float, int)):
            ranges[key] = max_val - min_val
        else:
            ranges[key] = np.nan

    return ranges


def p_types():
    """Returns the python (not C++) types of the parameters in pdict."""
    ptypes = {}
    for key, values in pdict.items():
        if all(isinstance(v, (int)) for v in values):
            ptypes[key] = int
        elif any(isinstance(v, (float)) for v in values):
            ptypes[key] = float
        elif any(isinstance(v, (str)) for v in values):
            ptypes[key] = str
        else:
            ptypes[key] = "type_not_found"
    return ptypes

