def plot_ranges(ranges):
    """Plots the ranges of the parameters in pdict."""
    keys = list(ranges.keys())
    vals = list(ranges.values())

    fig, ax = plt.subplots(figsize=(15, 5))
    ax.bar(keys, vals)
    # ax.set_ylim(0,1000)
    ax.set_xlabel('Range')
    ax.set_title('Ranges of the parameters in pdict')
    plt.xticks(rotation=90)
    plt.tight_layout()
    plt.show()


def plot_pdistributions():
    """Plots the distributions for each of the parameters in pdict."""
    plt.rcParams.update({"font.size": 7})
    pdict_num = get_num_pdict()
    ranges = p_ranges()
    fig, axs = plt.subplots(10, 10, figsize=(20, 20))
    idx = 0
    for i, (key, values) in enumerate(pdict_num.items()):
        if np.isnan(ranges[key]) or ranges[key] == 0:
            continue
        ax = axs.flatten()[idx]
        ax.hist(values, bins=20)
        ax.set_xlabel(key)
        # for label in ax.get_xticklabels():
        #     label.set_rotation(20)
        idx += 1
    plt.tight_layout()
    plt.show()

